//执行用时 :48 ms, 在所有 Go 提交中击败了97.83%的用户
//内存消耗 :6.3 MB, 在所有 Go 提交中击败了100.00%的用户
func maxDistance(grid [][]int) int {
	max := 0
	li, lj := len(grid), len(grid[0])
	noLand, noOcean := true, false
	for !noOcean {
		noOcean = true
		max++
		for i := range grid {
			for j := range grid[i] {
				if grid[i][j] == max {
					noLand = false
					if i > 0 && grid[i-1][j] == 0 {
						noOcean = false
						grid[i-1][j] = max + 1
					}
					if i < li-1 && grid[i+1][j] == 0 {
						noOcean = false
						grid[i+1][j] = max + 1
					}
					if j > 0 && grid[i][j-1] == 0 {
						noOcean = false
						grid[i][j-1] = max + 1
					}
					if j < lj-1 && grid[i][j+1] == 0 {
						noOcean = false
						grid[i][j+1] = max + 1
					}
				}
			}
		}
		if noLand {
			return -1
		}
		if noOcean {
			if max == 1 {
				return -1
			}
			max--
		}
	}
	return max
}
